import { useState } from 'react';
import List from '../components/List'


export default function NewList({addList, deleteList, switchLists}) {
  const [title, setTitle] = useState('')
  const editorId = 'x'.concat(String(Date.now()))


  return (
    <div>
      <form>
        <input 
          value={title} 
          placeholder='List title'
          onChange={e => setTitle(e.target.value)}
          type='text'
          name='title'
        > 
        </input>
        <button onClick={(e) => {

          e.preventDefault()
          addList(<List editorId={editorId} setTitle={setTitle} switchLists={switchLists} deleteList={deleteList} key={Math.random()} id={Math.random()} initialTitle={title || "Title"}/>)
          setTitle("")
          // console.log(lists.length)
          // console.log(newLists)
        }}>
          Click me
        </button>
      </form>
    </div>
  );
}
